    - id: keyPrefix
      type: System.String
      description: "\n<p>Specifies an optional key-prefix filter to apply during enumeration.</p>\n"
    - id: strictPrefix
      type: System.Boolean
      description: "\n<p>When true, only keys prefixed by the value specified for <strong>keyPrefix</strong> are returned. Otherwise, enumeration starts at the first key matching or lexicographically greater than <strong>keyPrefix</strong> and continues until there are no more keys. The default is <strong>true</strong>.</p>\n"
